import { Navigate } from "react-router-dom";
import Preview from "../Attendence/Preview";

export const PrivateRoute = () => {
  const { currentUser } = useSelector((state) => state.user);
  return currentUser && currentUser ? <Preview /> : <Navigate to="/"/>;
};
